double wbIK2_check_residual(double *target, double *multiplicand) {
  /* Returns the squared 2-norm of lhs - A*rhs. */
  /* Reuses v to find the residual. */
  int i;
  double residual;
  residual = 0;
  wbIK2_matrix_multiply(wbIK2_work.v, multiplicand);
  for (i = 0; i < 35; i++) {
    residual += (target[i] - wbIK2_work.v[i])*(target[i] - wbIK2_work.v[i]);
  }
  return residual;
}
